import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import LoginPage from './LoginPage';
import SignUpPage from './SignUpPage';
import './App.css';

const HomePage = () => {
  return (
    <div className="Home">
      <div className="Rectangle1"></div>
      <div className="Ellipse1"></div>
      <div className="Rectangle2"></div>
      <div className="Menu">
        <div className="home">HOME</div>
        <div className="Community">COMMUNITY</div>
        <div className="MyPage">MY_PAGE</div>
        <div className="Contact">CONTACT</div>
      </div>
      <div className="Intro">
        <div className="ForYourSafeTrading">FOR YOUR<br />SAFE TRADING</div>
        <div className="AskAnything">ASK ANYTHING</div>
      </div>
      <div className="Rectangle3"></div>

      <div className="WhatDoYouWantToKnow">What do you want to know?</div>
      <div className="Group4">
        <div className="Terms">Terms</div>
        <div className="Privacy">Privacy</div>
        <div className="Conditions">Conditions</div>
      </div>
      <Link to="/login" className="login-link">
        <div className="Rectangle4">Go</div>
      </Link>
    </div>
  );
}

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/signup" element={<SignUpPage />} />
      </Routes>
    </Router>
  );
}

export default App;
